name:sasl.oauthbearer.jwks.endpoint.url  read_only:Y  config_source:5  is_sensitive:N  config_type:2  documentation:\\\'The OAuth/OIDC provider URL from which the provider\\\\\\\'s <a href="https://datatracker.ietf.org/doc/html/rfc7517#section-5">JWKS (JSON Web Key Set)</a> can be retrieved. The URL can be HTTP(S)-based or file-based. If the URL is HTTP(S)-based, the JWKS data will be retrieved from the OAuth/OIDC provider via the configured URL on broker startup. All then-current keys will be cached on the broker for incoming requests. If an authentication request is received for a JWT that includes a "kid" header claim value that isn\\\\\\\'t yet in the cache, the JWKS endpoint will be queried again on demand. However, the broker polls the URL every sasl.oauthbearer.jwks.endpoint.refresh.ms milliseconds to refresh the cache with any forthcoming keys before any JWT requests that include them are received. If the URL is file-based, the broker will load the JWKS file from a configured location on startup. In the event that the JWT includes a "kid" header value that isn\\\\\\\'t in the JWKS file, the broker will reject the JWT and authentication will fail.\\\'\'  configs.43:\'kafka2.DescribeConfigsResourceResult32a  name:remote.log.metadata.custom.metadata.max.bytes  value:128  read_only:Y  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym32a  name:remote.log.metadata.custom.metadata.max.bytes  value:128  source:5"  config_type:3  documentation:"The maximum size of custom metadata in bytes that the broker should accept from a remote storage plugin. If custom  metadata exceeds this limit, the updated segment metadata will not be stored, the copied data will be attempted to delete, and the remote copying task for this topic-partition will stop with an error."\'  configs.44:\'kafka2.DescribeConfigsResourceResult32a  name:auto.include.jmx.reporter  value:true  read_only:Y  config_source:5  is_sensitive:N  synonyms.0:"kafka2.DescribeConfigsSynonym3